import logo from './logo.svg';
import './App.css';

import React, { useState } from 'react';


function App() {

  const BubbleSort = () => {
   const [arrNums, setArrNums] = useState([9, 1, 3, 2, 5, 6, 9, 4, 5, 7, 8]);
    console.log(arrNums)
  }



  BubbleSort();
  return (

    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
